## Set up a bibliography

1. Include the ```natbib``` package

```latex
\usepackage[bibmla]{natbib}
```

This loads the ```natbib``` package along with the ```mla``` style, which is required for the bibliography format. This will set up a bibliography using the MLA style, which is commonly used in the humanities and social sciences. For other citation styles, you can check out the available styles in the ```natbib``` documentation.

2. Start a bibliography

```latex
\begin{bibliograph}
```

A bibliography can be included with the ```bibliography``` environment, which is automatically set up by the ```natbib``` package. This environment can be used with any other environment in a LaTeX document.

3. Add bibliography entries to the ```bibliograph```

```latex
\bibliographytitle{Title}
\biblioauthors{Author1, Author2}
\biblioyear{2017}
\bibliovolume{10}
\bibliopages{1-10}
\biblioaddress{Address}
```

You can add as many fields as you want, and the bibliography will be formatted accordingly. If you would like to see an example of a complete ```natbib``` document, see the ```sample.tex``` file that comes with the ```natbib``` package.
